import React, { Component } from 'react'
import { Container, Row } from 'react-bootstrap'

import MobileService from '../../../service/mobile.service'

import MobilesCard from './Mobiles-card'

class AllMobiles extends Component {

    constructor() {
        super()
        this.state = {
            mobiles: []
        }
        this.mobilesService = new MobileService
    }

    refreshMobiles = () => {
        this.mobilesService
            .getMobiles()
            .then(res => this.setState({ mobiles: res.data }))
            .catch (err => console.log (err))
    }

    render() {
        return (
            <>
                <Container>

                    <h1>Listado de móviles</h1>

                    <Row>
                        {this.state.mobiles.map(elm=> <MobilesCard key={elm.id}{...elm}/>)}
                    </Row>

               </Container> 
                </>
        )
    }

}

export default AllMobiles
